import React from "react";
import { animateScroll } from "react-scroll";
import { HomePage } from "./home";
import './about.css';
import aboutpageimage from './Images/aboutpageimage.webp';
import aboutpagenameimage from './Images/aboutpagenameimage.jpg';

export function AboutMe(){
    return (
        <>
            <HomePage/>
            <div className="container-fluid row justify-content-around aboutpagediv">
                <div className="col-lg-5 mt-5">
                    <img src={aboutpageimage} alt="no images found" width="650"/>
                </div>
                <div className="col-lg-5 mt-5">
                    <img src={aboutpagenameimage} alt="no images found" width="450"/>
                </div>
            </div>
        </>
    );
}
